import Recat from 'react';

function User({ user }) {
  // if(!user )return null;

  return (
    <div>
      <div>
        <b>Id</b>:{user.id}
      </div>
      <div>
        <b>USERNAME</b>:{user.username}
      </div>

    </div>

  )
}
export default User;
